import Navbar from "./components/Navbar"
import Searchbox from './Searchbox';
import Products from "./components/Products"
import About from './About';
import Footer from './Footer';


function App()
{
    <div>
    <Navbar></Navbar>
    <Searchbox></Searchbox>
    <Products></Products>
    <About></About>
    <Footer></Footer>
  </div>
}
export default App
